import React from 'react';
import Card from './components/cards';
import sdata from './components/Sdata';
const favSeries = 'netflix';

const FavS = () =>{
if( favSeries === "netflix"){
    return(
  
        <Card
        key={sdata[0].id}
        imgsrc={sdata[0].imgsrc}
        title={sdata[0].title}
        sname={sdata[0].sname}
        links={sdata[0].links}/> 
      
      );
}
else{

    <Card
    key={sdata[1].id}
    imgsrc={sdata[1].imgsrc}
    title={sdata[1].title}
    sname={sdata[1].sname}
    links={sdata[1].links}/> 
  

}

}
const App = () =>{
   <>
 
  <h1>
    List of 3 best Nextflix series
  </h1>

  <FavS />


 
   </>
}

export default App;
